import {BrowserRouter as Router, Routes, Route} from "react-router-dom";
import {publicRouter} from "~/Routes/routes";
function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          {publicRouter.map()}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
